function receiveJSON(){

    fetch('http://localhost:3001/test', {
    method: 'POST',
    headers: {
        'Content-Type': 'application/json',
    },
    body: JSON.stringify({
        'email': 'sunghae',
        'password': '1234'
    })
    })
    .then(response => response.json())
    .then(response => {
    if (response.token) {
        localStorage.setItem('wtw-token', response.token);
    }
    })

}

export default receiveJSON;
